window.bookSummaryJSON = "<p><b>\"Vacker's overall performance, especially her solid pacing, will keep listeners guessing.\"—</b><b><i>AudioFile Magazine</i></b></p> <p><b>\"Clever and deliciously dark.”—Alice Feeney, bestselling author of </b><b><i>Rock Paper Scissors</i></b></p> <p><b>\"Narrator Karissa Vacker, with scores of audiobooks under her belt, provides a pitch-perfect performance in what, for some, would be a tough ask. Vacker's voice is a solid touchstone guiding listeners through shocks and twists.\"—</b><b><i>Booklist</i></b></p> <p><b><i>They were eleven when they sent a killer to prison. They were heroes . . . but they were liars.</i></b></p> <p><b>Kate Alice Marshall's </b><b><i>What Lies in the Woods</i></b><b> is a thrilling novel about friendship, secrets, betrayal, and lies—and having the courage to face the past.</b></p> <p>Naomi Shaw used to believe in magic. Twenty-two years ago, she and her two best friends, Cassidy and Olivia, spent the summer roaming the woods, imagining a world of ceremony and wonder. They called it the Goddess Game. The summer ended suddenly when Naomi was attacked. Miraculously, she survived her seventeen stab wounds and lived to identify the man who had hurt her. The girls’ testimony put away a serial killer, wanted for murdering six women. They were heroes.</p> <p>And they were liars.</p> <p>For decades, the friends have kept a secret worth killing for. But now Olivia wants to tell, and Naomi sets out to find out what <i>really</i> happened in the woods—no matter how dangerous the truth turns out to be.</p> <p><b>“</b><b><i>What Lies In the Woods</i></b><b> is a gorgeous fever dream of a novel about the dangers lurking in the hearts and imaginations of little girls. Kate Alice Marshall deftly charts a winding path through her creepy woods, doubling back and changing course to build a labyrinth of secrets and lies in which I was delighted to lose myself for hours. Hands down, it's the best thriller I've read in a long, long time.”—Chandler Baker, bestselling author of </b><b><i>The Husbands</i></b></p> <p><b>A Macmillan Audio production from Flatiron Books.</b></p>"; 
